/* eslint-disable jsx-a11y/anchor-is-valid */
/* eslint-disable jsx-a11y/anchor-has-content */
import React, { Component } from 'react';

class ButtonsGroup2 extends Component {
    render() {
        return (
            <>
                <div class="inline-flex items-center overflow-hidden text-white bg-blue-600 rounded">
                    <button class="p-3 bg-blue-600 focus:outline-none focus:bg-blue-700 active:bg-blue-500" type="button">
                        <span class="sr-only"> Prev </span>

                        <svg xmlns="http://www.w3.org/2000/svg" class="w-4 h-4" viewBox="0 0 20 20" fill="currentColor">
                        <path fill-rule="evenodd" d="M12.707 5.293a1 1 0 010 1.414L9.414 10l3.293 3.293a1 1 0 01-1.414 1.414l-4-4a1 1 0 010-1.414l4-4a1 1 0 011.414 0z" clip-rule="evenodd" />
                        </svg>
                    </button>

                    <span class="w-px h-4 bg-white/25"></span>

                    <button class="p-3 bg-blue-600 focus:outline-none focus:bg-blue-700 active:bg-blue-500" type="button">
                        <span class="sr-only"> Next </span>

                        <svg xmlns="http://www.w3.org/2000/svg" class="w-4 h-4" viewBox="0 0 20 20" fill="currentColor">
                        <path fill-rule="evenodd" d="M7.293 14.707a1 1 0 010-1.414L10.586 10 7.293 6.707a1 1 0 011.414-1.414l4 4a1 1 0 010 1.414l-4 4a1 1 0 01-1.414 0z" clip-rule="evenodd" />
                        </svg>
                    </button>
                </div>
            </>
        );
    }
}

export default ButtonsGroup2;
